import React from 'react';
import "./UserProfileMenu.css";
import { useState } from 'react'

const elements = [
    <div>
        <h2>This is div 1 </h2>
    </div>,
    <div>
        <h2>This is div 2 </h2>
    </div>,
    <div>
        <h2>This is div 3 </h2>
    </div>,
];

function UserProfileMenu() {
    const [index, setIndex] = useState(0);

    function clickHandler(index) {
        return () => setIndex(index);
    }

    return (
        <>
        <div className="UserProfileMenu">
            <ul className="MenuSelect">
                <li> <a onClick={clickHandler(0)}>Personal Information </a></li>
                <li> <a onClick={clickHandler(1)}>Professional Interests</a> </li>
                <li> <a onClick={clickHandler(2)}>Education</a> </li>
                <li> <a onClick={clickHandler(3)}>Experience</a> </li>
                <li> <a onClick={clickHandler(4)}>Projects</a> </li>
                <li> <a onClick={clickHandler(5)}>Resume</a> </li>

            </ul>
            <div>
            {elements[index]}
            </div>
        </div>
        </>
    );
}

function toggleDiv(divID) {
    let elem = document.getElementById(divID);
    return;
}

export default UserProfileMenu
